import React from "react";

const Calender = ({ className }) => {
  return (
    <svg
      width='21'
      height='21'
      viewBox='0 0 21 21'
      fill='none'
      xmlns='http://www.w3.org/2000/svg'
      className={className}
    >
      <path
        fillRule='evenodd'
        clipRule='evenodd'
        d='M20.25 1.5H18V0H16.5V1.5H4.5V0H3V1.5H0.75L0 2.25V20.25L0.75 21H20.25L21 20.25V2.25L20.25 1.5ZM19.5 19.5H1.5V6H19.5V19.5ZM19.5 4.5H1.5V3H19.5V4.5ZM4.5 10.5H3V12H4.5V10.5ZM3 13.5H4.5V15H3V13.5ZM4.5 16.5H3V18H4.5V16.5ZM7.5 10.5H9V12H7.5V10.5ZM9 13.5H7.5V15H9V13.5ZM7.5 16.5H9V18H7.5V16.5ZM9 7.5H7.5V9H9V7.5ZM12 10.5H13.5V12H12V10.5ZM13.5 13.5H12V15H13.5V13.5ZM12 16.5H13.5V18H12V16.5ZM13.5 7.5H12V9H13.5V7.5ZM16.5 10.5H18V12H16.5V10.5ZM18 13.5H16.5V15H18V13.5ZM16.5 7.5H18V9H16.5V7.5Z'
        fill='#F56E1E'
      />
    </svg>
  );
};

export default Calender;
